import React, { useState } from "react";

const UseStateObject = () => {
  const [person, setPerson] = useState({
    name: "Shubham Singh",
    age: 23,
    message: "Learning React.js",
  });
  console.log(person);
  return <h2>useState object example</h2>;
};

export default UseStateObject;
